import React,{lazy, useState} from "react";
import ".//menu.css"
const Main=lazy(()=>import ('./elementos/main'));
import ".//app.css";

const Menu=({ setProyecto, setName})=>{
    function abrir(proyecto,name){
        console.log(setProyecto(proyecto))
        setProyecto(proyecto);
        setName(name);
        setDeslizar("deslizar");
    }

    return(
        
        <div className="column menu">
             <div className="icon"></div>
             <br />
             <br />
            <button onClick={()=>{abrir("primer","Covid")}}>ðŸ’‰</button>
            <button onClick={()=>{abrir("segundo","Instrumento")}}>ðŸŽ¹</button>
            <button onClick={()=>{abrir("tercer","Clave")}}>ðŸ”‘</button>
            </div>
    )
}
const Viewer=({name})=>{
    const[deslizar,setDeslizar]=useState("no-deslizar")
    return(
        <div className="viewer">
        
        <h1 className={deslizar}>{name}</h1>
        </div>);
};

const App=()=>{
    const [proyecto,setProyecto]=useState("");
    const[name,setName]=useState("");

    return(
        <div className="app">
        <Menu setProyecto={setProyecto} setName={setName} />
        <Viewer name={name} />
        <Main setProyecto={proyecto} />
    </div>
    )
}
export default App
